import React from 'react';
// יציאה מתיקיית components וכניסה לתיקיית css
import '../css/Dashboard.css'; 

const Dashboard = () => {
  return (
    <div className="dashboard-container">
      <h1 className="dashboard-title">לוח בקרה ראשי</h1>
      
      <div className="cards-grid">
        {/* כרטיס 1 */}
        <div className="card">
          <h2>משתמשים פעילים</h2>
          <p>מספר המשתמשים המחוברים כרגע: <strong>142</strong></p>
        </div>

        {/* כרטיס 2 */}
        <div className="card">
          <h2>הכנסות חודשיות</h2>
          <p>סה"כ הכנסות לחודש זה: <strong>₪45,000</strong></p>
        </div>

        {/* כרטיס 3 */}
        <div className="card">
          <h2>משימות פתוחות</h2>
          <p>ישנן 3 משימות שממתינות לטיפול שלך.</p>
        </div>
        
        {/* כרטיס 4 */}
        <div className="card">
            <h2>הודעות מערכת</h2>
            <p>המערכת תעבור שדרוג הלילה בין 02:00 ל-04:00.</p>
        </div>
      </div>
    </div>
  );
};

export default Dashboard;
